import React from "react";

function Footer() {
  const year = new Date().getFullYear();

  return (
    <footer style={{ position: absolute, bottom: 0 }}>
      <h6>Hello Comono {year} from Medellín</h6>
    </footer>
  );
}

export default Footer;
